/*Table structure for table `t_detalle_actividad` */

DROP TABLE IF EXISTS `t_detalle_actividad`;

CREATE TABLE `t_detalle_actividad` (
  `ID_DETALLE_ACTIVIDAD` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ID_PROYECTO` int(11) NOT NULL,
  `ID_ACTIVIDAD` int(11) unsigned NOT NULL,
  `FEC_INI_PLANEADA` date DEFAULT NULL,
  `FEC_FIN_PLANEADA` date DEFAULT NULL,
  `PORCENTAJE_PLANEADO` int(3) DEFAULT NULL,
  `FEC_INI_REAL` date DEFAULT NULL,
  `FEC_FIN_REAL` date DEFAULT NULL,
  `PORCENTAJE_AVANCE` int(3) DEFAULT NULL,
  `CREATE_BY` int(11) DEFAULT NULL,
  `CREATE_ON` datetime DEFAULT NULL,
  `ESTATUS` int(1) DEFAULT '1',
  PRIMARY KEY (`ID_DETALLE_ACTIVIDAD`,`ID_PROYECTO`,`ID_ACTIVIDAD`),
  KEY `fk_id_proyecto` (`ID_PROYECTO`),
  KEY `fk_id_actividad` (`ID_ACTIVIDAD`),
  CONSTRAINT `fk_id_actividad` FOREIGN KEY (`ID_ACTIVIDAD`) REFERENCES `c_actividades` (`ID_ACTIVIDAD`),
  CONSTRAINT `fk_id_proyecto` FOREIGN KEY (`ID_PROYECTO`) REFERENCES `t_cartera_ejecutiva_proyectos` (`ID_PROYECTO`)
) ENGINE=InnoDB AUTO_INCREMENT=426 DEFAULT CHARSET=latin1;

