/*Table structure for table `t_grupos` */

DROP TABLE IF EXISTS `t_grupos`;

CREATE TABLE `t_grupos` (
  `ID_GRUPO` int(11) NOT NULL,
  `NOMBRE_GRUPO` varchar(25) NOT NULL,
  `DESCRIPTION` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`ID_GRUPO`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `t_grupos` */

insert  into `t_grupos`(`ID_GRUPO`,`NOMBRE_GRUPO`,`DESCRIPTION`) values (1,'admin','Administrador'),(2,'capturista','Capturista'),(3,'visualizador','Visualizador');

/*Table structure for table `t_ldap_ur` */

DROP TABLE IF EXISTS `t_ldap_ur`;

CREATE TABLE `t_ldap_ur` (
  `ID_LDAP_UR` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `NOMBRE_LDAP_UR` varchar(25) DEFAULT NULL,
  `SERVIDOR` varchar(15) DEFAULT NULL,
  `PUERTO` int(5) DEFAULT NULL,
  `OU` varchar(200) DEFAULT NULL,
  `DC` varchar(200) DEFAULT NULL,
  `DESCRIPCION` varchar(200) DEFAULT NULL,
  `ESTATUS` int(1) DEFAULT '1',
  `CREATE_BY` int(11) unsigned NOT NULL,
  `CREATE_ON` datetime DEFAULT NULL,
  PRIMARY KEY (`ID_LDAP_UR`,`CREATE_BY`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

