/*Table structure for table `t_usuario_grupos` */

DROP TABLE IF EXISTS `t_usuario_grupos`;

CREATE TABLE `t_usuario_grupos` (
  `ID_USUARIO_GRUPOS` int(11) NOT NULL AUTO_INCREMENT,
  `ID_USUARIO` int(11) unsigned NOT NULL,
  `ID_GRUPO` int(11) NOT NULL,
  PRIMARY KEY (`ID_USUARIO_GRUPOS`),
  KEY `fk_user` (`ID_USUARIO`),
  KEY `fk_grupo` (`ID_GRUPO`),
  CONSTRAINT `fk_grupo` FOREIGN KEY (`ID_GRUPO`) REFERENCES `t_grupos` (`ID_GRUPO`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_user` FOREIGN KEY (`ID_USUARIO`) REFERENCES `t_usuarios` (`ID_USUARIO`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=latin1;

